import{_ as e,c as r,a2 as n,o as l}from"./chunks/framework.D6PIRKQ_.js";const h=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"english/article/May.md","filePath":"english/article/May.md"}'),i={name:"english/article/May.md"};function a(d,t,s,o,g,c){return l(),r("div",null,t[0]||(t[0]=[n('<table tabindex="0"><thead><tr><th style="text-align:center;">underestimation<br>n. 低估<br>[经] 对...估价过低</th><th style="text-align:left;">While girls lack confidence , boys often overestimate their abilities.</th></tr></thead><tbody><tr><td style="text-align:center;">moniker [&#39;mɔnikә(r)]<br>n. 名字, 绰号</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">assertive [ә&#39;sә:tiv]<br>a. 武断的, 过分自信的<br>[法] 断言的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">phenomenal [fi&#39;nɒminәl]<br>a. 现象的, 能知觉的, 异常的, 显著的, 惊人的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">overestimate [.әuvәr&#39;estimeit]<br>vt. 评价过高, 过高估价<br>n. 估计过高, 评价过高</td><td style="text-align:left;">She tends to overestimate her abilities and often takes on more than she can handle.</td></tr><tr><td style="text-align:center;">restricted [ri&#39;striktid]<br>a. 受限制的, 有限的</td><td style="text-align:left;">Due to the COVID-19 pandemic, many countries have implemented restricted travel policies.</td></tr><tr><td style="text-align:center;">storytellers [ˈstɔ:ri:ˌteləz]<br>n. 讲故事的人, 说书人( storyteller的复数形式 )</td><td style="text-align:left;">The group of storytellers captivated the audience with their engaging tales.</td></tr><tr><td style="text-align:center;">gas pedal 油门踏板</td><td style="text-align:left;">The driver hit the gas pedal.</td></tr><tr><td style="text-align:center;">bombarded [bɔmˈbɑ:did]<br>v. 炮击( bombard的过去式和过去分词 ); 轰炸; 连珠炮般地提问; &lt;核&gt;以高能量粒子或放射能冲击</td><td style="text-align:left;">The students were bombarded with assignments during the exam week.</td></tr><tr><td style="text-align:center;">ferocious [fә&#39;rәuʃәs]<br>a. 残忍的, 凶猛的, 可怕的</td><td style="text-align:left;">The ferocious lion roared loudly as it defended its territory from intruders.</td></tr><tr><td style="text-align:center;">intruders [ɪnˈtru:dəz]<br>n. 未请自入者, 闯入者（尤指企图行窃者）( intruder的复数形式 )</td><td style="text-align:left;">The security alarm went off when the intruders attempted to break into the house.</td></tr><tr><td style="text-align:center;">intensity [in&#39;tensәti]<br>n. 强烈, 紧张, 强度<br>[计] 强度; 亮度</td><td style="text-align:left;">The intensity of the sunlight made her squint.</td></tr><tr><td style="text-align:center;">squint [skwint]<br>n. 斜视眼, 斜着<br>a. 斜视的<br>vt. 使变斜视眼<br>vi. 斜视, 倾向, 斜行</td><td style="text-align:left;">He had to squint his eyes to read the small print on the sign.</td></tr><tr><td style="text-align:center;">stuck out 突出</td><td style="text-align:left;">The little boy stuck out his tongue in a playful manner.</td></tr><tr><td style="text-align:center;">succumb [sә&#39;kʌm]<br>vi. 屈从, 屈服, 死</td><td style="text-align:left;">He couldn&#39;t resist the temptation and succumbed to the delicious aroma of freshly baked cookies.</td></tr><tr><td style="text-align:center;">impulse [&#39;impʌls]<br>n. 冲动, 驱使, 刺激, 推动, 冲力, 建议, 脉冲<br>vt. 推动</td><td style="text-align:left;">She acted on impulse and bought the colorful dress without thinking twice.</td></tr><tr><td style="text-align:center;">Chances are, so do you. 很有可能，你也是。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">hamsters [&#39;hæmstəz]<br>n. &lt;动&gt;仓鼠( hamster的复数形式 )</td><td style="text-align:left;">My sister loves taking care of her pet hamsters and watching them play in their cage.</td></tr><tr><td style="text-align:center;">ephemeral [i&#39;femәrәl]<br>a. 朝生暮死的, 短命的, 短暂的<br>[医] 暂时的</td><td style="text-align:left;">The beauty of cherry blossoms is ephemeral, as the delicate flowers bloom for only a short period of time each year.</td></tr><tr><td style="text-align:center;">novelty [&#39;nɒvәlti]<br>n. 新奇, 新鲜, 新奇的事物</td><td style="text-align:left;">The children&#39;s excitement was evident as they played with their new toys, enjoying the novelty of the unique features and designs.</td></tr><tr><td style="text-align:center;">timelessness [&#39;taɪmləsnəs]<br>n. 无时间限制</td><td style="text-align:left;">Love knows no bounds of time and exudes timeless beauty.</td></tr><tr><td style="text-align:center;">engulfed [enˈgʌlft]<br>v. 吞没, 包住( engulf的过去式和过去分词 )</td><td style="text-align:left;">The fire engulfed the building.</td></tr><tr><td style="text-align:center;">slightest<br>a. 极不重要的, 最少的</td><td style="text-align:left;">He was always ready to defend himself at the slightest provocation.</td></tr><tr><td style="text-align:center;">provocation [.prɒvә&#39;keiʃәn]<br>n. 激怒, 刺激, 挑拨<br>[医] 激发[作用]</td><td style="text-align:left;">He resisted the urge to respond to her provocation and remained calm.</td></tr><tr><td style="text-align:center;">fortunate [&#39;fɒ:tʃәnit]<br>a. 幸运的, 幸福的</td><td style="text-align:left;">I realize that I’m incredibly fortunate.</td></tr><tr><td style="text-align:center;">permanently [&#39;p\\:mәntli]<br>adv. 永久, 不变, 持久<br>[计] 永久性的</td><td style="text-align:left;">The decision to move to another country was made with the intention of permanently settling there.</td></tr><tr><td style="text-align:center;">basking [bæskɪŋ]<br>v. 晒太阳, 取暖( bask的现在分词 ); 对…感到乐趣; 因他人的功绩而出名; 仰仗…的余泽</td><td style="text-align:left;">The successful author enjoyed basking in the praise and recognition of her readers.</td></tr><tr><td style="text-align:center;">windowsill [&#39;windәusil]<br>n. 窗台</td><td style="text-align:left;">he sat by the windowsill, sipping her morning coffee and enjoying the view.</td></tr><tr><td style="text-align:center;">allure [ә&#39;luә]<br>vt. 引诱, 吸引<br>n. 魅力, 诱惑力</td><td style="text-align:left;">The sparkling diamond necklace had an allure that captivated everyone&#39;s attention.</td></tr><tr><td style="text-align:center;">unstable [.ʌn&#39;steibl]<br>a. 不稳定的</td><td style="text-align:left;">I have an unstable schedule</td></tr><tr><td style="text-align:center;">willpower [&#39;wilpauә]<br>n. 毅力, 意志力</td><td style="text-align:left;">She relied on her willpower to resist the temptation of indulging in unhealthy snacks.</td></tr><tr><td style="text-align:center;">consequences [ˈkɔnsikwənsiz]<br>n. 重要（性）( consequence的复数形式 ); 结果; 重要地位; 因果关系</td><td style="text-align:left;">He understood the consequences of his actions and took responsibility for them.</td></tr><tr><td style="text-align:center;">lenient [&#39;li:njәnt]<br>a. 宽大的, 温和的, 慈悲为怀的<br>[法] 宽大的, 仁慈的</td><td style="text-align:left;">The teacher was lenient with the students and allowed them extra time to complete the assignment.</td></tr><tr><td style="text-align:center;">sentence [&#39;sentәns]<br>n. 句子, 命题, 宣判<br>vt. 宣判, 判决<br>[计] 句子</td><td style="text-align:left;">The judge was lenient and gave the first-time offender a light sentence.</td></tr><tr><td style="text-align:center;">supervised<br>a. 有监督的</td><td style="text-align:left;">most adults need to be supervised to a certain extent</td></tr><tr><td style="text-align:center;">streak [stri:k]<br>n. 条理, 斑纹, 倾向<br>vt. 加条纹<br>vi. 变成条纹, 飞跑</td><td style="text-align:left;">The artist showcased her creative streak with a series of stunning paintings.</td></tr><tr><td style="text-align:center;">aesthetic [i:s&#39;θetik]<br>a. 美学的, 审美的, 有美感的</td><td style="text-align:left;">The photographer captured the natural beauty of the landscape in a way that was both artistic and aesthetic.</td></tr><tr><td style="text-align:center;">cringe [krindʒ]<br>n. 畏缩, 奉承<br>vi. 畏缩, 抖缩, 阿谀</td><td style="text-align:left;">He couldn&#39;t help but cringe at his own embarrassing mistake during the presentation.</td></tr><tr><td style="text-align:center;">exoskeleton [,eksәu&#39;skelitәn]<br>n. 外骨胳, 外甲<br>[医] 外骨骼</td><td style="text-align:left;">I was amazed by the strength and agility of the robot, which was equipped with an exoskeleton to assist with heavy lifting.</td></tr><tr><td style="text-align:center;">agility [ә&#39;dʒiliti]<br>n. 敏捷, 灵活, 机敏</td><td style="text-align:left;">The athlete&#39;s agility on the soccer field allowed them to swiftly navigate through defenders and score a remarkable goal.</td></tr><tr><td style="text-align:center;">spectacular [spek&#39;tækjulә]<br>a. 公开展示的, 惊人的, 壮观的<br>n. 奇观, 惊人之举, 展览物</td><td style="text-align:left;">The fireworks display on New Year&#39;s Eve was absolutely spectacular, lighting up the night sky with vibrant colors and dazzling patterns.</td></tr><tr><td style="text-align:center;">siblings [&#39;sɪblɪŋz]<br>n. 兄弟, 姐妹( sibling的复数形式 )</td><td style="text-align:left;">I have two siblings, an older sister and a younger brother, and we always have a great time when we get together for family gatherings.</td></tr><tr><td style="text-align:center;">Even though 尽管</td><td style="text-align:left;">Even though it was raining heavily, they still went for a hike in the mountains.</td></tr><tr><td style="text-align:center;">quality [&#39;kwɒlәti]<br>n. 品质, 特性, 才能, 质量<br>a. 优质的<br>[计] 品质</td><td style="text-align:left;">The company prides itself on producing high-quality products that are built to last and meet the needs of its customers.</td></tr><tr><td style="text-align:center;">quantity [&#39;kwɒntәti]<br>n. 量, 数量, 总量<br>[计] 数量; 量</td><td style="text-align:left;">The grocery store offers discounts for purchasing items in large quantities, encouraging customers to buy in bulk and save money.</td></tr><tr><td style="text-align:center;">&quot;For instance&quot; 用来提供一个具体的例子来支持或阐述前面所说的观点或主题。它用于强调一个特定的例子或情况，以更清楚地说明或证明某个观点。</td><td style="text-align:left;">I enjoy various outdoor activities. For instance, last weekend I went hiking in the mountains and explored a beautiful waterfall.</td></tr><tr><td style="text-align:center;">&quot;Such as&quot; 通常用于列举例子，用来引入一个或多个具体的例子，以说明所讨论的事物的范围或类别。它用来提供更具体的细节和例子来支持主题。</td><td style="text-align:left;">I enjoy outdoor activities such as hiking, biking, and camping.</td></tr><tr><td style="text-align:center;">dilemma [di&#39;lemә]<br>n. 困境, (进退两难的)窘境</td><td style="text-align:left;">She faced a dilemma when she had to choose between accepting a job offer in a different city or staying close to her family and friends.</td></tr><tr><td style="text-align:center;">realm [relm]<br>n. 王国, 领土, 领域<br>[计] 领域</td><td style="text-align:left;">The novel takes readers on a thrilling journey into the realm of fantasy, where magic and mythical creatures exist.</td></tr><tr><td style="text-align:center;">tradeoffs [&#39;treid,ɔ:f]<br>n. 权衡；折衷；（公平）交易（等于trade-off）</td><td style="text-align:left;">you make tradeoffs between the quality, quantity, and time to finish the work.</td></tr><tr><td style="text-align:center;">allocates [ˈæləkeits]<br>v. 分配, 分派( allocate的第三人称单数 ); 把…拨给</td><td style="text-align:left;">The government allocates a significant portion of its budget to education, ensuring that resources are properly distributed to schools and educational programs.</td></tr><tr><td style="text-align:center;">crave [kreiv]<br>v. 渴望, 热望, 恳求</td><td style="text-align:left;">After a long day at work, I often crave a hot cup of tea and some quiet time to relax and unwind.</td></tr><tr><td style="text-align:center;">executive [ig&#39;zekjutiv]<br>n. 执行部门, 执行委员会, 执行者, 经理主管人员<br>a. 执行的, 善于执行的, 善于经营的<br>[计] 执行程序</td><td style="text-align:left;">The executive team of the company met to discuss the strategic direction and make important decisions for the future of the organization.</td></tr><tr><td style="text-align:center;">elation [i&#39;leiʃәn]<br>n. 得意洋洋, 兴高采烈<br>[医] 得意[洋洋], 高兴</td><td style="text-align:left;">I’ve experienced elation and defeat within moments of each other.</td></tr><tr><td style="text-align:center;">alignment [ә&#39;lainmәnt]<br>n. 队列, 结盟, 校正<br>[计] 校准; 对齐; 对准</td><td style="text-align:left;">In order to achieve success, it is crucial for the goals and values of individuals within a team to be in alignment with the overall objectives of the organization.</td></tr><tr><td style="text-align:center;">intoxicating [in&#39;tɔksikeitiŋ]<br>a. 醉人的,使人兴奋的</td><td style="text-align:left;">The aroma of freshly brewed coffee filled the room, creating an intoxicating and inviting atmosphere.</td></tr><tr><td style="text-align:center;">tormenting [tɔ: &#39;mentiŋ, &#39;tɔ: m-]<br>a. 使痛苦的, 使苦恼的</td><td style="text-align:left;">The constant sound of dripping water from the leaky faucet became tormenting, keeping me awake throughout the night.</td></tr><tr><td style="text-align:center;">faucet [&#39;fɒ:sit]<br>n. 龙头, 开关, 旋塞</td><td style="text-align:left;">I turned on the faucet to fill the sink with warm water for washing the dishes.</td></tr><tr><td style="text-align:center;">scattered [&#39;skætәd]<br>a. 分散的, 散乱的<br>[计] 分散的</td><td style="text-align:left;">The children&#39;s toys were scattered all over the living room, making it difficult to walk without stepping on something.</td></tr><tr><td style="text-align:center;">stepping [&#39;stepiŋ]<br>[计] 步进式, 改变</td><td style="text-align:left;">She took a deep breath, steeling herself and stepping onto the stage to deliver her speech with confidence.</td></tr><tr><td style="text-align:center;">distanced<br>vt. 把…远远甩在后面（distance的过去式与过去分词形式）</td><td style="text-align:left;">Focusing so much on the company has also distanced me from friends and family as a result.</td></tr><tr><td style="text-align:center;">aversion [ә&#39;vә:ʃәn]<br>n. 厌恶, 讨厌的事, 讨厌的人<br>[医] 厌恶, 移转, 移位</td><td style="text-align:left;">I have a strong aversion to spiders, and even the sight of one makes me feel uneasy.</td></tr><tr><td style="text-align:center;">retreated [riˈtri:tid]<br>v. 撤退( retreat的过去式和过去分词 ); 隐退; 离开; 规避</td><td style="text-align:left;">I’ve retreated into silence instead of saying what I think.</td></tr><tr><td style="text-align:center;">compassion [kәm&#39;pæʃәn]<br>n. 同情, 怜悯</td><td style="text-align:left;">What looks like compassion in the short term can lead to destruction in the long term.</td></tr><tr><td style="text-align:center;">botched [bɔtʃt]<br>v. 修补( botch的过去式和过去分词 ); 搞坏, 搞砸, 笨拙地做</td><td style="text-align:left;">The DIY home improvement project was completely botched, with crooked shelves, mismatched paint, and loose fixtures.</td></tr><tr><td style="text-align:center;">recruiting [riˈkru:tɪŋ]<br>v. 招聘( recruit的现在分词 ); 吸收某人为新成员; 动员…（提供帮助）; 雇用</td><td style="text-align:left;">The company is actively recruiting talented individuals with diverse skill sets to join their growing team.</td></tr><tr><td style="text-align:center;">Tactically [&#39;tæktɪklɪ]<br>adv. 在战术上</td><td style="text-align:left;">The team strategically and tactically planned their moves before entering the competition, considering both offensive and defensive strategies</td></tr><tr><td style="text-align:center;">crippling [&#39;kripliŋ]<br>(往复)曲折, 断裂, 临界的, 极限的</td><td style="text-align:left;">The sudden loss of their major client dealt a crippling blow to the company, forcing them to downsize and restructure.</td></tr><tr><td style="text-align:center;">irony [&#39;aiәrәni]<br>n. 反语, 讽刺, 具有讽刺意味的事</td><td style="text-align:left;">The irony of the situation was that the traffic police officer received a speeding ticket while on duty.</td></tr><tr><td style="text-align:center;">turbulent [&#39;tә:bjulәnt]<br>a. 狂暴的, 骚乱的, 紊乱的</td><td style="text-align:left;">The airline experienced turbulent weather during the flight, causing some passengers to feel uneasy and prompting the captain to request everyone to fasten their seatbelts.</td></tr><tr><td style="text-align:center;">purposefully<br>adv. 自觉地；有目的地</td><td style="text-align:left;">The artist purposefully selected a vibrant color palette to evoke a sense of joy and energy in their painting.</td></tr><tr><td style="text-align:center;">palette [&#39;pælit]<br>n. 调色板, 颜料<br>[计] 调色板</td><td style="text-align:left;">The chef carefully selected a diverse palette of flavors and ingredients to create a culinary masterpiece.</td></tr><tr><td style="text-align:center;">culinary [&#39;kʌlinәri]<br>a. 厨房的, 烹调用的</td><td style="text-align:left;">The culinary school offers a wide range of courses that teach students various cooking techniques and culinary arts.</td></tr><tr><td style="text-align:center;">masterpiece [&#39;mɑ:stәpi:s]<br>n. 杰作, 名著</td><td style="text-align:left;">The artist&#39;s latest painting is truly a masterpiece, showcasing their exceptional talent and creativity.</td></tr><tr><td style="text-align:center;">haywire [&#39;heiwaiә]<br>[计] 临时的</td><td style="text-align:left;">After the power outage, the electrical system in the building went haywire, causing lights to flicker and appliances to malfunction.</td></tr><tr><td style="text-align:center;">flicker [&#39;flikә]<br>n. 闪烁, 闪光, 颤动<br>vi. 闪动, 闪烁, 摇动, 扑动翅膀<br>vt. 使摇曳, 使闪烁</td><td style="text-align:left;">The candlelight flickered gently, casting dancing shadows on the walls and creating a cozy atmosphere.</td></tr><tr><td style="text-align:center;">malfunction [.mæl&#39;fʌŋʃәn]<br>n. 故障, 失灵, 疾病<br>vi. 发生故障, 不起作用<br>[计] 故障</td><td style="text-align:left;">The computer malfunctioned and crashed, causing all the unsaved work to be lost.</td></tr><tr><td style="text-align:center;">freak out 吓坏了</td><td style="text-align:left;">She saw a spider in her bedroom and freaked out, screaming and jumping onto the nearest chair.</td></tr><tr><td style="text-align:center;">stifled<br>堵</td><td style="text-align:left;">This stifled me. 这让我窒息。</td></tr><tr><td style="text-align:center;">maximally [&#39;mæksiməli]<br>adv. 最大地；最高地</td><td style="text-align:left;">The team worked together to utilize their resources maximally, ensuring that every member contributed their best to achieve the project&#39;s goals.</td></tr><tr><td style="text-align:center;">muses<br>n. 缪斯（诸女神）、灵感</td><td style="text-align:left;">The artist found inspiration in nature, music, and literature, all serving as his muses for creating beautiful artworks.</td></tr><tr><td style="text-align:center;">innovators [ˈɪnəveɪtə(r)]<br>n. 改革者( innovator的复数形式 ); 刷新者</td><td style="text-align:left;">The conference brought together some of the brightest minds and innovators from various industries to share their groundbreaking ideas and insights.</td></tr><tr><td style="text-align:center;">cyclicality<br>n. 周期；周期性</td><td style="text-align:left;">The stock market is known for its cyclicality, with periods of expansion and contraction that repeat over time.</td></tr><tr><td style="text-align:center;">oscillated [ˈɔsəˌleɪtid]<br>v. （使）摆动( oscillate的过去式和过去分词 )</td><td style="text-align:left;">The temperature in the room oscillated between hot and cold, making it uncomfortable to find a comfortable setting.</td></tr><tr><td style="text-align:center;">Disbanding [dɪsˈbændɪŋ]<br>v. （使）解散, 散伙, 解体( disband的现在分词 )</td><td style="text-align:left;">The band announced their disbanding after years of performing together, citing creative differences as the main reason.</td></tr><tr><td style="text-align:center;">arduous [&#39;ɑ:djuәs]<br>a. 费力的, 努力的, 险峻的</td><td style="text-align:left;">The climbers embarked on an arduous journey to reach the summit of the mountain, facing treacherous terrain and extreme weather conditions.</td></tr><tr><td style="text-align:center;">payroll [&#39;peirәul]<br>n. 工资名单, 饷金名单, 发放的工资总额<br>[计] 工资表, 工资单</td><td style="text-align:left;">The HR department is responsible for managing the company&#39;s payroll, ensuring that employees are paid accurately and on time.</td></tr><tr><td style="text-align:center;">reimbursements [ˌri:ɪmˈbɜ:smənts]<br>n. 偿还( reimbursement的复数形式 ); 退款; 补偿; 赔偿</td><td style="text-align:left;">The company offers travel expense reimbursements to its employees for business-related trips.</td></tr><tr><td style="text-align:center;">backbone [&#39;bækbәun]<br>n. 脊椎, 志气, 骨干, 支柱<br>[计] 主干网, 主干网点</td><td style="text-align:left;">Effective communication is the backbone of a successful relationship.</td></tr><tr><td style="text-align:center;">nebulous [&#39;nebjulәs]<br>a. 星云的, 星云状的, 朦胧的</td><td style="text-align:left;">After hours of brainstorming, their initial ideas evolved into a nebulous concept that required further clarification.</td></tr><tr><td style="text-align:center;">competence [&#39;kɒmpitәns]<br>n. 胜任, 职称, 能力<br>[医] 能力, 活性</td><td style="text-align:left;">Having strong problem-solving skills is a key competence that is highly valued in the workplace.</td></tr><tr><td style="text-align:center;">bait [beit]<br>n. 饵<br>vt. 以饵引诱, 欺负<br>vi. 中途休息</td><td style="text-align:left;">Sharing the job description felt like putting bait into a pond without fish.</td></tr><tr><td style="text-align:center;">jovial [&#39;dʒәuviәl]<br>a. 快活的, 高兴的, 愉快的<br>[计] 国际算法语言的朱尔斯文本</td><td style="text-align:left;">Despite the long day at work, Sarah remained jovial and greeted everyone with a warm smile.</td></tr><tr><td style="text-align:center;">aligned<br>a. 对齐的；均衡的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">instructive [in&#39;strʌktiv]<br>a. 有益的, 增进知识的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">resume [ri&#39;zju:m]<br>vt. 重新开始, 取回, 恢复<br>vi. 再开始<br>n. 摘要, 个人简历<br>[计] 继续执行</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">Judaism [&#39;dʒu:diizm]<br>n. 犹太教, 犹太文明, 犹太教信仰</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">sensory [&#39;sensәri]<br>a. 知觉的, 感觉的, 传递感觉的<br>[医] 感觉的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">metaphors<br>n. 隐喻（metaphor的复数形式）</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">profound [prә&#39;faund]<br>a. 极深的, 深厚的, 深刻的, 渊博的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">mediocrity [.mi:di&#39;ɒkriti]<br>n. 平常, 平庸之才</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">meekness [&#39;mi:knis]<br>n. 温顺, 柔和</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">tapestry [&#39;tæpistri]<br>n. 挂毯, 绒绣<br>vt. 用挂毯装饰</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">tattoos<br>n. 刺青, 纹身（tattoo的复数）</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">salience [&#39;seiliәns]<br>n. 显著, 卓越, 突出, 突起, 特征</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">resonate [&#39;rezәneit]<br>v. (使)共鸣, (使)共振</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">osmosis [ɒz&#39;mәusis]<br>n. 渗透作用, 渗透性, 潜移默化, 耳濡目染<br>[化] 渗透; 渗透作用</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">embodiment [im&#39;bɒdimәnt]<br>n. 具体化, 化身</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">unmistakably [ˌʌnmɪ&#39;steɪkəblɪ]<br>adv. 显而易见地; 不会弄错地; 不会误解地; 明白地</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">hierarchies [ˈhaiərɑ:kiz]<br>n. 等级制度( hierarchy的名词复数 ); 统治集团; 领导层; 层次体系</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">grand [grænd]<br>a. 庄重的, 壮观的, 显赫的, 重大的, 最高的, 雄伟的, 宏大的, 豪华的, 傲慢的<br>[法] 重大的, 主要的, 伟大的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">finality [fai&#39;næliti]<br>n. 终结, 定局, 终结性言行<br>[法] 终结, 定局, 决定性</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">conglomerate [kәn&#39;glɒmәrit]<br>a. 聚成球形的, 砾岩性的<br>n. 集成物, 混合体, 砾岩<br>v. (使)凝聚成团</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">dumbfounding [dʌm&#39;faʊndɪŋ]<br>v. 使人哑然失声, 使发楞( dumbfound的现在分词 )</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">overhauling [,әuvә&#39;hɔ:liŋ]<br>n. 彻底检修, 彻底检查<br>[化] 大修; 拆修; 卸修; 翻修</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">exhilarating [ig&#39;zilәreitiŋ]<br>a. 令人喜欢的, 使人愉快的, 爽快的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">gusto [&#39;gʌstәu]<br>n. 爱好, 嗜好, 由衷的高兴</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">delusion [di&#39;lu:ʒәn]<br>n. 迷惑, 欺瞒, 错觉<br>[医] 妄想</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">hindrance [&#39;hindrәns]<br>n. 妨害, 障碍, 阻碍物</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">meritocracy [.meri&#39;tɒkrәsi]<br>n. 精英领导阶级</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">bootstrapping [&#39;bu:tstræpiŋ]<br>[计] 自展, 自举, 引导</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">trustworthy [&#39;trʌst.wә:ði]<br>a. 可信赖的<br>[法] 可信任的, 可靠的, 可信赖的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">meager [&#39;mi:gә]<br>a. 质量差的, 贫乏的, 不毛的, 瘦的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">landed [&#39;lændid]<br>a. 拥有土地的, 有田地的<br>[法] 不动产的, 拥有土地的, 地皮的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">dialup<br>n. 拨电话号码</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">overachieving</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">respectably</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">overachieve</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">bootstrapping</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">quarantine</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">inane</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">methodology</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">integrating</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">observation</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">irrational</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">authoritarian</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">inconsistent</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">implicitly</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">monumentally</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">monumentally hard</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">explicit [ik&#39;splisit]<br>a. 详述的, 清楚的, 直言的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">scaffolding [&#39;skæfәldiŋ]<br>n. 脚手架, 台架, (搭脚手架用的)支杆和木板, (喻)(论点等的)支柱<br>[化] 搭脚手架</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">undervalues [ˌʌndəˈvælju:z]<br>v. 对（某人或某事物）评价过低, 低估（某人或某事物）( undervalue的第三人称单数 )</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">alternative [ɒ:l&#39;tә:nәtiv]<br>n. 两者择一, 供替代的选择<br>a. 两者择一的, 供选择的<br>[计] 选择对象</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">astrophysics [.æstrәu&#39;fiziks]<br>n. 天体物理学<br>[化] 天体物理; 天体物理学</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">siren [&#39;saiәrin]<br>n. 女海妖, 妖女, 警报器, 汽笛, 迷人的美女<br>a. 诱惑的<br>vi. 响着警报器前进</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">remorse [ri&#39;mɒ:s]<br>n. 懊悔, 良心不安, 自责, 同情<br>[法] 悔恨, 自责, 懊悔</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">generalisability<br>[网络] 普遍性；可适性；可推论程度</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">jotted<br>v. 摘记下来</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">scratchings<br>(scratching 的复数) v. 擦伤；划伤；刮痕（scratch的ing形式）</td><td style="text-align:left;">filled with half jotted down ideas</td></tr><tr><td style="text-align:center;">acquaintances [ək&#39;weɪntənsɪz]<br>n. 相识的人( acquaintance的复数形式 ); 熟人; 对…有了解; （与某人）认识</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">demonstrated [ˈdemənstreitid]<br>v. 举行示威游行（或集会）( demonstrate的过去式和过去分词 ); 示范。展示; 显示; 论证</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">philosophy [fi&#39;lɒsәfi]<br>n. 哲学, 人生观, 哲学思想, 哲理, 基本原理, 见解, 达观, 沉着</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">summoned [ˈsʌmənd]<br>v. 传唤( summon的过去式和过去分词 ); 召唤; 传讯（出庭）; 鼓起（勇气）</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">whim [hwim]<br>n. 一时的兴致, 冲动, 怪念头, 绞盘</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">blacksmith [&#39;blæksmiθ]<br>n. 铁匠<br>[机] 铁匠</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">musty [&#39;mʌsti]<br>a. 发霉的, 霉臭的, 落伍的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">laboriously<br>adv. 辛苦地；费力地；不流畅地</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">crafting<br>n. 工艺；手工艺</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">capricious [kә&#39;priʃәs]<br>a. 反复无常的, 多变的, 任性的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">dormant [&#39;dɒ:mәnt]<br>a. 睡眠状态的, 静止的<br>[医] 休眠的, 不活动的, 休止的</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">slumbering<br>v. 微睡, 睡眠（slumber的现在分词形式）</td><td style="text-align:left;"></td></tr><tr><td style="text-align:center;">breadcrumbs [ˈbredkrʌmz]<br>n. （烹调食物时）在…上覆以面包屑( breadcrumb的复数形式 )</td><td style="text-align:left;"></td></tr></tbody></table>',1)]))}const f=e(i,[["render",a]]);export{h as __pageData,f as default};
